import React from 'react'
import {
    Flex,
    Box,
    Heading,
    Text,
    Image
} from 'rebass';
import Macklist from '../assets/images/Macklist.gif'

function ProjectInfo(props) {
    return (
        <Flex>
            <Box>
                <Heading marginTop={40}>{props.children}</Heading>
                <br></br>
                <Text>{props.text}</Text>
            </Box>
        </Flex>
    )
}

export default ProjectInfo
